text:
Across Ontario, Liberals are working hard to elect a strong team who will fight for Ontario families. We can make a difference, together.
//
D’un bout à l’autre de l’Ontario, les libéraux travaillent fort à faire élire une équipe solide qui se battra pour les familles. Ensemble, on peut faire pencher la balance.

“We can dare to dream about a Canada without poverty, but it’s going to take bold action.” - Adam van Koeverden
//
« On peut oser rêver d’un Canada sans pauvreté, mais cela prendra des mesures plus qu’audacieuses. » - Adam van Koeverden

Nos équipes sillonnent le Québec tout entier afin de vous parler, de mieux comprendre vos besoins et de vous parler de notre plan pour rendre votre vie plus abordable. 
//
Liberal teams across Quebec are engaging with their communities to hear your priorities and share our plan to make life more affordable.

We need to keep growing the economy and investing in Canadians, but as we’ve seen in Ontario and in the Conservative platform, all the Conservatives have to offer are cuts and austerity. 
//
Nous devons continuer à faire croître l’économie et à investir dans les Canadiens. Comme nous l’avons vu en Ontario et dans la plateforme d’Andrew Scheer, les conservateurs n’ont que des coupes et de l’austérité à offrir.

Atlantic Canada is ready to choose forward - because this team will never stop working hard for you.
//
Les gens du Canada atlantique sont prêts à choisir d'avancer - parce que cette équipe ne cessera jamais de travailler fort pour vous.

Advance voting starts TODAY! Polls are open today until Monday from 9 AM to 9 PM all across the country! Make your vote plan now: http://lpc.ca/apsh
//
On peut voter par anticipation dès AUJOURD’HUI! Les bureaux de vote seront ouverts jusqu’à lundi, de 9 h à 21 h, partout au pays! Faites votre plan pour voter maintenant : http://lpc.ca/apsi

Ginette Petitpas Taylor is the best progressive voice for Moncton–Riverview–Dieppe - take it from Luc LeBlanc ⬇️ 
//
Ginette Petitpas Taylor est la meilleure voix progressiste pour Moncton–Riverview–Dieppe, et Luc LeBlanc vous le confirme! ⬇️

Andrew Scheer ne croit pas que les femmes devraient avoir le droit de disposer de leur propre corps. On ne peut se permettre de reculer. Justin Trudeau défendra toujours le droit des femmes de choisir. 
//
Andrew Scheer doesn't believe women should have the right to choose what to do with their own bodies.  We can't afford to go backwards. Justin Trudeau will always stand up for a woman's right to choose.

If they’re elected, the Conservatives will change the tax system only to benefit the wealthiest Canadians. That’s not right. Liberals will cut taxes so middle class families get $600 and the wealthiest one percent get zero. 
//
S’ils sont réélus, les conservateurs changeront le régime fiscal à l’avantage des Canadiens les plus riches. Ça n’a aucun sens. Les libéraux baisseront les impôts, ce qui donnera 600 $ aux familles de la classe moyenne et rien du tout au un pour cent des plus riches.

Steven Guilbeault le sait : Lorsqu’il est question de lutter contre les changements climatiques, on peut en faire plus, et c’est qu’on va faire. On va continuer d’agir pour le climat. Pour notre planète, nos enfants et leur avenir.
//
Steven Guilbeault knows: When it comes to fighting climate change, there's more we can do, and we will! We’ll keep taking real climate action. For our planet, our kids, and their future.

Un gouvernement conservateur dirigé par Andrew Scheer va :
✅nommer un député du Québec ministre responsable de l'Agence de développement économique pour les régions du Québec et un ministre politique du Québec;
✅faciliter la vie des Québécois en instaurant un rapport d'impôt unique;
✅supprimer la TPS des factures d'hydro et de chauffage résidentiel;
✅respecter le Québec en lui donnant plus d’autonomie en matière d’immigration;
✅supprimer l’impôt fédéral sur le revenu des prestations de maternité et parentales du Régime québécois d’assurance parentale; et
✅mettre fin aux déversements d'eaux usées.

Our Liberal candidates on Vancouver Island know - the climate crisis is the biggest challenge of our generation, and our team has the best plan to fight it.
//
Nos candidats libéraux sur l'île de Vancouver le savent bien : la crise climatique est le plus grand défi de notre génération et notre équipe a le meilleur plan pour la combattre.

Number of the day: 25! We’re going to conserve and protect 25% of Canada’s land and 25% of Canada’s oceans by 2025! 
//
Le nombre du jour : 25! On va conserver et protéger 25 % des territoires et 25 % des océans du Canada d’ici 2025!

Politics is about people - listening to you and making your voice heard. We love Randy Boissonnault & Loraine’s story - check it out ⤵️ 
//
Derrière la politique, il y a les gens. Des gens qu’il faut écouter pour s’assurer qu’ils soient entendus. Quelle belle histoire que celle de Loraine et Randy - à regarder ⤵️

If we work together, we can win the fight against climate change. Use our new profile frame to show that you’re with us.
//
Si on se met au travail ensemble, on peut gagner la lutte aux changements climatiques. Utilisez notre nouveau cadre de profil pour montrer que vous êtes avec nous.

Un nouveau gouvernement conservateur va rendre les rénovations plus abordables. Il permettra aux Canadiens de:
✅Installer de l'isolant de haute qualité;
✅Investir dans une fournaise à haute efficacité;
✅Remplacer des portes et des fenêtres;
✅Mettre à jour leurs systèmes de ventilation, de chauffage et de climatisation; et
✅Installer des panneaux solaires.

Too many Canadians still fall through the cracks of our health care system - and it’s time to fix that. Stay tuned today for our next step towards more accessible and affordable health care in Canada.
//
Trop de Canadiens tombent encore entre les mailles du filet de notre système de santé ⎼ et c’est le temps que ça change. Soyez à l’écoute aujourd’hui pour une annonce des prochaines étapes de notre plan pour rendre les soins de santé plus accessibles et abordables.

The Liberal government cut taxes for the middle class, and put more money in your pockets. Stay tuned today for the next step in our plan to keep making life more affordable for families.
//
Le gouvernement libéral a baissé l'impôt de la classe moyenne, et remis plus d’argent dans vos poches. Plus tard aujourd'hui, nous annoncerons les prochaines étapes de notre plan pour rendre la vie plus abordable pour les familles.

Gun crime is on the rise in Canada. It’s time for tougher gun control, not weaker gun laws like the Conservatives want. It’s time to choose forward. 
//
Les crimes commis avec des armes à feu sont en hausse au Canada. Nous avons besoin d’un contrôle plus strict des armes à feu et non de l’affaiblir comme les conservateurs le souhaitent. C’est le temps de choisir d'avancer.

After a lifetime of hard work, Canadian seniors deserve a secure retirement and a good quality of life. We’re announcing the next steps in our plan to support seniors today. Stay tuned!
//
Nos aînés méritent une retraite plus sûre et confortable après avoir travaillé aussi fort toute leur vie. Nous annonçons aujourd’hui les prochaines étapes de notre plan pour mieux soutenir nos aînés.

Parents across the country work hard everyday to give their kids the best possible start in life & we want to help make it easier and more affordable. Stay tuned for an announcement today!
//
Chaque jour, les parents à travers le pays travaillent fort pour offrir à leurs enfants le meilleur départ possible dans la vie. On veut les aider à y arriver en leur offrant des services plus accessibles et plus abordables. Surveillez notre annonce aujourd’hui!

Notre plan va mettre plus d’argent dans vos poches en :
✅réduisant l’impôt sur le revenu de pension;
✅supprimant la TPS ds factures d’hydro et de chauffage résidentiel;
✅annulant la taxe sur le carbone et;
✅augmentant le crédit en raison de l’âge.

Small businesses are the backbone of this country. Announcement coming today on our next steps for helping SMEs grow and thrive - stay tuned!
//
Les petites entreprises sont le pilier de l’économie canadienne. À venir : annonce des prochaines étapes de notre plan pour aider les PME à prospérer. Soyez à l'écoute!

Our tax credits for kids’ activities will:
✔️Allow parents to claim up to $1,000 per child for expenses related to fitness or sports--related activities;
✔️Allow parents to claim up to $500 per child for expenses related to arts and educational activities and;
✔️Make the credit refundable so low-income Canadians benefit most.
Learn more about our plan to make life more affordable for you and your family: http://cpcp.cc/bu6ELe.

🎥Jagmeet et notre équipe ont rencontré beaucoup de monde cette semaine. Regardez ces points saillants de la tournée : ▶️⬇️

//

🎥 Jagmeet and our team have connected with so many people this week. Check out these highlights from the road: ▶️⬇️

De Trois-Rivières à Sherbrooke et partout ailleurs au Québec, l'Équipe Trudeau est déterminée à mettre en œuvre de son plan visant à investir dans la classe moyenne.
//
From Trois-Rivières to Sherbrooke and all across Quebec, Team Trudeau is focused on moving forward with our plan to invest in the middle class.

Jagmeet et l’équipe ont fait beaucoup de chemin au cours des derniers jours. D'un rassemblement à Toronto à des discussions avec des familles à London et à Hamilton, les gens sont excités à l’idée d’avoir un leader qui se bat pour eux. Les faits saillants :

//

Over the last few days, Jagmeet and the team have covered a lot of ground. From rallying in Toronto to talking to families in London and Hamilton, it’s been clear – people are excited to stand with a leader who will fight for them. Check out some highlights:

At the end of the day, politics is about people – and that’s why Team Trudeau is staying focused on you. 
//
Car au bout du compte, derrière la politique, il y a des gens – voilà pourquoi vous demeurez la priorité de l’Équipe Trudeau.

Cela fait deux ans qu'Andrew Scheer est chef du Parti conservateur et il n'a toujours aucun plan …

❌  de croissance économique;
❌  d'aide aux familles de la classe moyenne;
❌  de lutte contre les changements climatiques

Justin Trudeau et l'équipe libérale réalisent des progrès concrets et positifs pour les Canadiens, mais il reste encore beaucoup à faire.🇨🇦

En 2015, les Canadiens ont fait un choix. 
🇨🇦 Ils ont choisi l’espoir et non la peur; 
🇨🇦 le travail acharné et non le cynisme; 
🇨🇦 le progrès et non le statu quo. 
Quatre ans plus tard, ils font face au même choix. 

À moins de 150 jours de l’élection, l’#ÉquipeTrudeau est prête!
